    return(
        <>
            <div className="container contact-page">
                <div className="text-zone">
                    <h1>
                        <AnimatedLetters  strArray={['C', 'o', 'n' ,'t', 'a', 'c', 't', ' ', 'm', 'e']} idx={15} />
                    </h1>
                </div>
            </div>
            <Loader type="ball-clip-rotate-multiple" />
        </>
    )
}
export default Contact;
